import React from 'react';

const Profile = () => {

    return (
        <div className='text-center'>
            <div>emailID: {}</div>
            <div>Firstname: {localStorage.getItem("Name")}</div>
            <div>LastName: {localStorage.getItem("lastName")}</div>
            <div>Password: {localStorage.getItem("password")}</div>
        </div>
    );
};

export default Profile;
